def xml_to_dict(xml_str):
    result = dict()
    xml = ET.fromstring(xml_str)
    for table in xml.getiterator('head'):
        for child in table:
            # print(child.tag, child.text)
            if child.text:
                result[child.tag] = urllib.parse.unquote(child.text)
    return result


